DROP DATABASE IF EXISTS incubator_tracker;
CREATE DATABASE incubator_tracker;
USE incubator_tracker;
SET FOREIGN_KEY_CHECKS = 0;

CREATE TABLE People (
  person_id INT PRIMARY KEY,
  name VARCHAR(200),
  gender VARCHAR(20),
  phone VARCHAR(50),
  email VARCHAR(200),
  date_of_birth DATE
) ENGINE=InnoDB;


CREATE TABLE Entrepreneur (
  entrepreneur_id INT PRIMARY KEY,
  university VARCHAR(200),
  major VARCHAR(100),
  person_id INT NOT NULL,
  FOREIGN KEY (person_id) REFERENCES People(person_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE Mentor (
  mentor_id INT PRIMARY KEY,
  expertise VARCHAR(200),
  organization VARCHAR(200),
  availability VARCHAR(50) DEFAULT 'Available',
  person_id INT NOT NULL,
  FOREIGN KEY (person_id) REFERENCES People(person_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE Investor (
  investor_id INT PRIMARY KEY,
  organization VARCHAR(200),
  capacity_min DECIMAL(12,2),
  capacity_max DECIMAL(12,2),
  preferred_industries VARCHAR(255),
  person_id INT NOT NULL,
  FOREIGN KEY (person_id) REFERENCES People(person_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE Event (
  event_id INT PRIMARY KEY,
  title VARCHAR(255),
  type VARCHAR(100),
  location VARCHAR(200),
  host VARCHAR(200),
  event_date DATE
) ENGINE=InnoDB;


CREATE TABLE Startup (
  startup_id INT PRIMARY KEY,
  name VARCHAR(255),
  industry VARCHAR(100),
  stage VARCHAR(50),
  date_founded DATE,
  description TEXT
) ENGINE=InnoDB;


CREATE TABLE FundingRound (
  funding_id INT PRIMARY KEY,
  date_of_round DATE,
  amount DECIMAL(15,2),
  round_stage VARCHAR(50),
  notes TEXT,
  startup_id INT NOT NULL,
  FOREIGN KEY (startup_id) REFERENCES Startup(startup_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE EntrepreneurStartup (
  entrepreneur_id INT,
  startup_id INT,
  role VARCHAR(50),
  PRIMARY KEY (entrepreneur_id, startup_id),
  FOREIGN KEY (entrepreneur_id) REFERENCES Entrepreneur(entrepreneur_id) ON DELETE CASCADE,
  FOREIGN KEY (startup_id) REFERENCES Startup(startup_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE StartupMentor (
  startup_id INT,
  mentor_id INT,
  role VARCHAR(50),
  start_date DATE,
  end_date DATE,
  PRIMARY KEY (startup_id, mentor_id),
  FOREIGN KEY (startup_id) REFERENCES Startup(startup_id) ON DELETE CASCADE,
  FOREIGN KEY (mentor_id) REFERENCES Mentor(mentor_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE FundingInvestor (
  funding_id INT,
  investor_id INT,
  invested_amount DECIMAL(15,2),
  PRIMARY KEY (funding_id, investor_id),
  FOREIGN KEY (funding_id) REFERENCES FundingRound(funding_id) ON DELETE CASCADE,
  FOREIGN KEY (investor_id) REFERENCES Investor(investor_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE EntrepreneurEvent (
  entrepreneur_id INT,
  event_id INT,
  role VARCHAR(50),
  PRIMARY KEY (entrepreneur_id, event_id),
  FOREIGN KEY (entrepreneur_id) REFERENCES Entrepreneur(entrepreneur_id) ON DELETE CASCADE,
  FOREIGN KEY (event_id) REFERENCES Event(event_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE StartupEvent (
  startup_id INT,
  event_id INT,
  role VARCHAR(50),
  PRIMARY KEY (startup_id, event_id),
  FOREIGN KEY (startup_id) REFERENCES Startup(startup_id) ON DELETE CASCADE,
  FOREIGN KEY (event_id) REFERENCES Event(event_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE MentorEvent (
  mentor_id INT,
  event_id INT,
  role VARCHAR(50),
  PRIMARY KEY (mentor_id, event_id),
  FOREIGN KEY (mentor_id) REFERENCES Mentor(mentor_id) ON DELETE CASCADE,
  FOREIGN KEY (event_id) REFERENCES Event(event_id) ON DELETE CASCADE
) ENGINE=InnoDB;


CREATE TABLE InvestorEvent (
  investor_id INT,
  event_id INT,
  role VARCHAR(50),
  PRIMARY KEY (investor_id, event_id),
  FOREIGN KEY (investor_id) REFERENCES Investor(investor_id) ON DELETE CASCADE,
  FOREIGN KEY (event_id) REFERENCES Event(event_id) ON DELETE CASCADE
) ENGINE=InnoDB;




